      body: "Hi,\r\nI respect your work and know how much it is useful, but I can't\
        \ integrate it with my python code\r\nI want you to give a standard onnx format\
        \ model so that everyone like me can make prediction and use it anyway wanted\
        \ maybe for even classification task\r\nDoes all predictions made by yolov6?\
        \ And why don't you use yolov7 as it is fast\r\nCan you give links about guide\
        \ on how did you actually trained the model for custom classification like\
        \ dog_with_open_eyes\r\nI also want to use it to solve recaptcha\r\nBasically,\
        \ I am making a pypi version of library that can handle every captcha with\
        \ single line like this\r\n```\r\nsolver = CaptchaSolver().setCaptchaTypeAs#anylikehcaptcha.solve()\r\
        \n```\r\nI actually got success with very good accuracy using efficientnet\
        \ before but it can't predict new classes that hcaptcha made recently\r\n\
        Also, I have solved too many classes of recaptcha, text captcha, upside down\
        \ captcha, duplicate image finder captcha, slide captcha, and many more, generally\
        \ 9 types supported by it\r\nI want you to contribute in it by giving me and\
        \ teaching me how to do custom classification task, dataset length required\
        \ for it and give me yolov6 in h5 or onnx format\r\nThanks"
